\\eth.png\" style=\"max-height: 1.5rem;\"> Ethereum</button> -->\n                <button class=\"btn coin2 shadow hovhovhov2\"><img src=\"storage\\icons\\ltc.png\" style=\"max-height: 1.5rem;\"> Litecoin</button>\n                <button class=\"btn coin3 shadow hovhovhov2\"><img src=\"storage\\icons\\rvn.png\" style=\"max-height: 1.5rem;\"> Ravencoin</button>\n        <button class=\"btn coin5 shadow hovhovhov2\"><img src=\"storage\\icons\\btg.png\" style=\"max-height: 1.5rem;\"> Bitcoin Gold</button>\n                \n    </div>\n\n\n\n\n\n<div id=\"FAQBTC\" class=\"content container-fluid\" style=\"display: none; margin-top: 40px;\">\n    \n<ul class=\"nav nav-pills mb-3 mx-auto\" id=\"pills-tab\" role=\"tablist\"\n    style=\"width: fit-content; border-bottom: groove; padding: 10px;\">\n    <li class=\"nav-item\">\n        <a class=\"nav-link\" id=\"pills-home-tab\" data-toggle=\"pill\" href=\"#pills-home\" role=\"tab\"\n            aria-controls=\"pills-home\" aria-selected=\"false\" style=\"color:black;\"><i class=\"fa fa-play\" aria-hidden=\"true\"></i>\n            Начало работы</a>\n    </li>\n    <li class=\"nav-item\">\n        <a class=\"nav-link\" id=\"pills-contact-tab\" data-toggle=\"pill\" href=\"#pills-contact\" role=\"tab\"\n            aria-controls=\"pills-contact\" aria-selected=\"false\" style=\"color:black;\"><i class=\"fa fa-headphones\" aria-hidden=\"true\"></i>\n            Поддержка</a>\n    </li>\n    <li class=\"nav-item\">\n        <a class=\"nav-link active\" id=\"pills-profile-tab\" data-toggle=\"pill\" href=\"#pills-profile\" role=\"tab\"\n            aria-controls=\"pills-profile\" aria-selected=\"true\" style=\"color:black;\"><i class=\"fa fa-question\" aria-hidden=\"true\"></i>\n            FAQ</a>\n    </li>\n    <li class=\"nav-item\">\n        <a class=\"nav-link\" id=\"pills-API-tab\" data-toggle=\"pill\" href=\"#pills-API\" role=\"tab\" aria-controls=\"pills-API\"\n            aria-selected=\"false\"style=\"color:black;\" ><i class=\"fa fa-database\" aria-hidden=\"true\"></i>\n            API документация</a>\n    </li>\n    <li class=\"nav-item\">\n        <a class=\"nav-link\" id=\"pills-CONNECT-tab\" data-toggle=\"pill\" href=\"#pills-CONNECT\" role=\"tab\"\n            aria-controls=\"pills-CONNECT\" aria-selected=\"false\" style=\"color:black;\"><i class=\"fa fa-cogs\" aria-hidden=\"true\"></i>\n            Подключение к пулу</a>\n    </li>\n</ul>\n<div class=\"tab-content\" id=\"pills-tabContent\">\n    <div class=\"tab-pane fade\" id=\"pills-home\" role=\"tabpanel\" aria-labelledby=\"pills-home-tab\">\n        <h2 class=\"c-title\">Создание аккаунта</h2>\n        <p>Зарегистрируйте аккаунт, чтобы получить доступ к личному кабинету, где у вас будет возможность смотреть\n            статистику по майнерам, баланс и получать выплаты.</p>\n        <h2 class=\"c-title\">Подключение майнеров</h2>\n        <p>В данный момент пул поддерживает майнинг только с использованием ASICs. <br>Для подключения майнеров\n            необходимо зайти в веб-интерфейс для управления майнером, перейти во вкладку <strong>Miner\n                Configuration</strong> и добавить адреса нашего пула.</p>\n        <h3>Основной пул.</h3>\n        <table>\n            <tr>\n                <td width=\"200\">Pool1 URL</td>\n                <td>stratum+tcp://eu.btc.sigmapool.com:3333</td>\n            </tr>\n            <tr>\n                <td>Pool1 worker</td>\n                <td>username.workername</td>\n            </tr>\n            <tr>\n                <td>Pool1 password</td>\n                <td>x</td>\n            </tr>\n        </table>\n        <h3>Backup-пул</h3>\n        <p>Желательно установить для того, чтобы в случае потери связи с основным пулом майнер автоматически\n            переключился на Backup пул - в результате ни одна шара не потеряется. После возобновления работы основного\n            пула, майнер сразу переключится на него.</p>\n        <hr>\n        <table>\n            <tr>\n                <td width=\"200\">Pool2 URL</td>\n                <td>stratum+tcp://eu1.btc.sigmapool.com:3333</td>\n            </tr>\n            <tr>\n                <td>Pool2 worker</td>\n                <td>username.workername</td>\n            </tr>\n            <tr>\n                <td>Pool2 password</td>\n                <td>x</td>\n            </tr>\n        </table>\n        <p>В качестве <strong>username</strong> используйте то имя пользователя, которое указали при регистрации.\n            Регистр не важен. <br>В качестве <strong>workername</strong> можете выбрать любое подходящее вам название,\n            однако оно не должно содержать знаков, за исключением нижнего подчеркивания _.</p>\n        <p>Вы можете указывать одинаковый <strong>workername</strong> для нескольких майнеров, либо не указывать его\n            совсем. В таком случае имя воркера сгенерируется автоматически, а параметр <strong>worker</strong> в\n            настройках пула будет содержать только имя пользователя.</p>\n        <p>Пример параметра <strong>без указания workername</strong>: “username”.</p>\n        <h2 class=\"c-title\">Мониторинг</h2>\n        <p>После начала майнинга на нашем пуле через 2-5 минут вы можете зайти в личный кабинет и наблюдать за графиком\n            хешрейта, среднего хешрейта, кол-ва шар, видеть хешрейт в реальном времени и средний за 24 часа, а также\n            ориентировочный прогноз дохода от майнинга с учетом вашей мощности.</p>\n        <p>В разделе Workers можно удобно просматривать детальную информацию по каждому воркеру, а на странице Payments\n            видеть всю историю выплат и текущий баланс.</p>\n        <p>В настройках можно установить кошелек для выплат, сменить пароль и выставить настройку приватности для\n            скрытия имени пользователя из публичного списка майнеров.</p>\n    </div>\n    <div class=\"tab-pane fade show active\" id=\"pills-profile\" role=\"tabpanel\" aria-labelledby=\"pills-profile-tab\">\n        <h2>Как узнать сколько я смогу заработать?</h2>\n        <p>Для этого перейдите в личный кабинет в раздел Dashboard. Там вы можете смотреть прогноз доходов с учетом\n            вашего текущего хешрейта.</p>\n        <h2>PPS или FPPS, что выбрать?</h2>\n        <p>PPS (или Pay per Share) – метод, основанный на фиксированной оплате за предоставленную майнером мощность.\n            Цена формируется на основании общей сложности сети и суммы награды за блок.</p>\n        <p>FPPS (Full Pay per Share) метод позволяет майнерам получать долю в виде сборов за транзакции. Плата\n            рассчитывается за определённый период, добавляется к вознаграждению за блок, а затем распределяется среди\n            майнеров в соответствии с описанной выше моделью PPS. Комиссия при данном методе составляет 4%.</p>\n        <p>У этих типов вознаграждений есть свои особенности, поэтому рекомендуем Вам протестировать оба варианта и\n            решить для себя, какой из них больше подходит для Ваших мощностей.</p>\n        <h2>Почему майнить на SigmaPool выгоднее?</h2>\n        <p>В данный момент на нашем пуле вы получаете 100% PPS – мы не будем брать с Вас никаких комиссий. Мы\n            постарались сделать статистику максимально подробной, чтобы Вы всегда могли понимать, сколько зарабатываете.\n        </p>\n        <h2>Как настроить выплаты с пула на кошелек?</h2>\n        <p>Для этого необходимо перейти в Личный кабинет, далее в раздел Настройки и там установить адрес своего\n            кошелька для выплат.</p>\n        <h2>Что случится, если не указать кошелек для выплат в настройках?</h2>\n        <p>Ваш баланс будет расти по мере поступления начислений. Как только Вы укажете адрес в настройках, произойдет\n            автоматический вывод всех средств на Ваш кошелек. При поступлении новых начислений также будут работать\n            авто-выплаты. Вы можете убрать адрес из настроек в любой момент для временной приостановки вывода средств с\n            баланса. При сохранении адрес кошелька проверяется на валидность, чтобы обеспечить защиту от выплат на\n            несуществующий адрес.</p>\n        <h2>Есть ли у вас реферальная программа?</h2>\n        <p>Наша реферальная система сейчас в разработке. Вы всегда можете связаться с нашей клиентской поддержкой по\n            этому вопросу.</p>\n        <h2>Почему у меня много Discarded Shares?</h2>\n        <p>Discarded (сброшенные) шары имели бы смысл, если бы пул работал по протоколу getwork (и даже в таком случае\n            этот параметр важен только оператору пула, а не майнеру). Этот параметр на 100% неважен на GBT и Stratum (мы\n            используем Stratum). Сброшенные шары не относятся к отклоненным и не являются шарами вовсе. Данный\n            показатель означает, что Ваше программное обеспечение получило шары для расчета хэшей, а затем сбросило их,\n            получив более свежие и актуальные шары. Таким образом, Вы не теряете хэши, когда ваш майнер сбрасывает шары.\n        </p>\n        <h2>Могу ли я получать выплаты в другой валюте?</h2>\n        <p>Интеграция с ShapeShift запланирована на ближайшее время. После этого Вы сможете получать выплаты в удобной\n            для Вас валюте.</p>\n        <h2>Поддерживается ли технология AsicBoost?</h2>\n        <p>Да, поддерживается. Также, при использовании прошивки SigmaBoost, Вы сможете использовать все преимущества\n            данной технологии.</p>\n        <h2>Где я могу следить за новостями?</h2>\n        <p>С нашим телеграм-каналом @RU_Sigmapool (EN_Sigmapool) Вы сможете всегда быть в курсе последних событий,\n            которые, в свою очередь, сможете обсудить в телеграм-чате @Sigmapool_RU (@Sigmapool_EN)</p>\n        <h2>В какое время происходят выплаты?</h2>\n        <p>Выплаты на BTC пуле производятся один раз в сутки в промежуток 9:00-11:00 (UTC). Баланс должен быть выше\n            порога выплат на момент самой выплаты, а адрес выплат подтвержден.</p>\n        <h2>Почему кошелек не изменился при введении адреса в строку \"адрес выплат\"?</h2>\n        <p>Действия по изменению адреса выплат необходимо подтверждать, переходя по ссылке в письме что Вам\n            отправляется. Это действует как дополнительная защита, даже если злоумышленники смогут проникнуть в Ваш\n            аккаунт - они не смогут изменить Ваш адрес выплат так просто.</p>\n        <h2>Почему я не могу выбрать PPLNS на BTC пуле?</h2>\n        <p>В данный момент на BTC пуле доступны схемы выплат PPS и FPPS. PPLNS имеет высокий риск долгое время оставлять\n            майнера без начислений. С ростом общего хэшрейта на пуле возможность использовать PPLNS может появиться.</p>\n        <h2>Что такое 2-х часовое SMA на графике?</h2>\n        <p>Это скользящая средняя за 2 часа, которая выглядит на графике как толстая линия. Если у Вас, к примеру, был\n            подключен один аппарат и через время Вы подключили второй, то эта линия плавно поднимется вверх, в то время\n            как график хэшрейта резко подскочит.</p>\n        <h2>Как долго занимает появление воркеров на сайте после подключения?</h2>\n        <p>Отображение воркеров на сайте после подключения может занимать до 15 минут. Если Вы указали все верно, а в\n            настройках воркеры так и не появились - обращайтесь в чат технической поддержки.</p>\n        <h2>У меня возникли проблемы на пуле/с прошивкой/с мобильным приложением! Куда обращаться?</h2>\n        <p>Наши специалисты на связи круглосуточно. Вы можете</p>\n        <p>- написать письмо на <a href=\"/cdn-cgi/l/email-protection\" class=\"__cf_email__\"\n                data-cfemail=\"3e4d4b4e4e514c4a7e4d5759535f4e515152105d5153\">[email&#160;protected]</a>;</p>\n        <p>- заполнить форму на сайте во вкладке \"Помощь/Поддержка\";</p>\n        <p>- написать нашему Telegram-боту: @SigmaPoolSupport_bot или обратитесь в живой-чат поддержки прямо на сайте.\n        </p>\n        <h2>Какие правила для имени пользователя существуют на пуле и как имя майнера?</h2>\n        <p>Имя пользователя в процессе регистрации может содержать только английские буквы нижнего регистра и цифры\n            (a-z, 0-9). Идентификатор майнера, установленный в конфигурации воркера, должен соответствовать следующей\n            схеме: username.workername (имя пользователя в строчных буквенно-цифровых символах и имя воркера,\n            разделенное символом точки). Обратите внимание, что это ваш собственный риск, и у вас могут возникнуть\n            проблемы с вознаграждениями и хэшрейтом, если вы установите имя, которое не соответствует правилам.</p>\n    </div>\n    <div class=\"tab-pane fade\" id=\"pills-contact\" role=\"tabpanel\" aria-labelledby=\"pills-contact-tab\">\n        (formmaker){\"id\":\"1\"}</div>\n    <div class=\"tab-pane fade\" id=\"pills-API\" role=\"tabpanel\" aria-labelledby=\"pills-API-tab\">\n        <h2 class=\"c-title\">API</h2>\n        <p>The <strong>SigmaPool API</strong> uses an <strong>API Key</strong> to identify your application.</p>\n        <p><a href=\"/settings#api\">Get API Key</a></p><br>\n        <h2>Stats</h2>\n        <p>Detailed miner statistics.</p>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/stats?key=API_KEY\" readonly></div>\n        </div>\n        <h2>Workers</h2>\n        <p>Statistics for all miners. </p>\n        <p>By default it gives you all miners (offline and online), you can use <strong> status </strong> (\'any\',\n            \'online\', \'offline\') param to select what miners you want to get </p>\n        <p><strong>Limit</strong> and <strong>page</strong> params are optional.</p>\n        <p>You can also pass <strong>search</strong> param to filter workers by name.</p>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/workers?limit=25&amp;page=1&amp;key=API_KEY\" readonly></div>\n        </div>\n        <p><strong>Count</strong> value for pagination</p>\n        <p>By default it gives you all miners (offline and online), you can use <strong> status </strong> (\'any\',\n            \'online\', \'offline\') param to select what miners you want to get </p>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/workers/count?key=API_KEY\" readonly></div>\n        </div>\n        <h2>Earnings</h2>\n        <p>History of all miner rewards.</p>\n        <p><strong>Limit</strong> and <strong>page</strong> params are optional.</p>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/earnings?limit=25&amp;page=1&amp;key=API_KEY\" readonly>\n            </div>\n        </div>\n        <p><strong>Count</strong> value for pagination</p>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/earnings/count?key=API_KEY\" readonly></div>\n        </div>\n        <h2>Daily Earnings</h2>\n        <p>History of daily rewards with hashrate.</p>\n        <p><strong>Limit</strong> and <strong>page</strong> params are optional.</p>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/dailyearnings?limit=25&amp;page=1&amp;key=API_KEY\" readonly>\n            </div>\n        </div>\n        <p><strong>Count</strong> value for pagination</p>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/dailyearnings/count?key=API_KEY\" readonly></div>\n        </div>\n        <h2>Payments</h2>\n        <p>History of all account payments.</p>\n        <p><strong>Limit</strong> and <strong>page</strong> params are optional.</p>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/payments?limit=25&amp;page=1&amp;key=API_KEY\" readonly>\n            </div>\n        </div>\n        <p><strong>Count</strong> value for pagination</p>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/payments/count?key=API_KEY\" readonly></div>\n        </div>\n        <h2>Charts</h2>\n        <p>History of reported hashrate and shares.</p>\n        <p>PERIOD values: <strong>12h</strong>, <strong>24h</strong>, <strong>3d</strong>.</p>\n        <h3>Hashrate</h3>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label><input\n                    class=\"basic-form__line basic-input\" type=\"text\"\n                    value=\"https://btc.sigmapool.com/api/v1/charts/hashrate?period=PERIOD&amp;key=API_KEY\" readonly>\n            </div>\n        </div>\n\n        <h3>SMA 2H Hashrate</h3>\n        <div class=\"basic-form settings-form long\">\n            <div class=\"basic-form__line\"><label class=\"basic-form__label\">GET</label></div>\n        </div>\n    </div>\n    <div class=\"tab-pane fade\" id=\"pills-CONNECT\" role=\"tabpanel\" aria-labelledby=\"pills-CONNECT-tab\">\n        <h2>Подключение к пулу <a href=\"/getting-started\">(?)</a></h2>\n        <div class=\"settings-block__content\">\n            <form class=\"basic-form settings-form\">\n                <div class=\"basic-form__line inline\"><label class=\"basic-form__label url__label\">EU Сервер\n                        #1</label><input class=\"basic-form__line basic-input\" type=\"text\"\n                        value=\"stratum+tcp://eu1.btc.sigmapool.com:3333\" readonly></div>\n                <div class=\"basic-form__line inline\"><label class=\"basic-form__label url__label\">EU Сервер\n                        #2</label><input class=\"basic-form__line basic-input\" type=\"text\"\n                        value=\"stratum+tcp://eu2.btc.sigmapool.com:3333\" readonly></div>\n                <div class=\"basic-form__line inline\"><label class=\"basic-form__label url__label\">EU Сервер\n                        #3</label><input class=\"basic-form__line basic-input\" type=\"text\"\n                        value=\"stratum+tcp://eu3.btc.sigmapool.com:3333\" readonly></div>\n                <div class=\"basic-form__line inline\"><label class=\"basic-form__label url__label\">EU Сервер\n                        #4</label><input class=\"basic-form__line basic-input\" type=\"text\"\n                        value=\"stratum+tcp://eu4.btc.sigmapool.com:3333\" readonly></div>\n                <div class=\"basic-form__line inline\"><label class=\"basic-form__label url__label\">US Сервер\n                        #1</label><input class=\"basic-form__line basic-input\" type=\"text\"\n                        value=\"stratum+tcp://us1.btc.sigmapool.com:3333\" readonly></div>\n                <div class=\"basic-form__line inline\"><label class=\"basic-form__label url__label\">US Сервер\n                        #2</label><input class=\"basic-form__line basic-input\" type=\"text\"\n                        value=\"stratum+tcp://us2.btc.sigmapool.com:3333\" readonly></div>\n                <div class=\"basic-form__line inline\"><label class=\"basic-form__label url__label\">China\n                        Сервер</label><input class=\"basic-form__line basic-input\" type=\"text\"\n                        value=\"stratum+tcp://cn1.btc.sigmapool.com:3333\" readonly></div>\n            </form>\n        </div>\n    </div>\n</div>\n</div>\n\n <!--\n<div id=\"accordion\">\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"headingOne\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne\" aria-expanded=\"true\"\n                    aria-controls=\"collapseOne\">\n                    Как вывести монеты? Как сделать выплату?\n                </button>\n            </h5>\n        </div>\n\n        <div id=\"collapseOne\" class=\"collapse show\" aria-labelledby=\"headingOne\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                Выплаты происходят автоматически в течение двух часов после того, как ваш баланс достиг минимально\n                необходимой величины: 0.05 для Ethereum, 0.1 для прочих Dagger Hashimoto монет, 0.01 для Equihash монет\n                и т.д. Минимальный размер выплаты указан на главной странице пула каждой монеты. Например, для Ethereum:\n\n                mceclip0.png\n\n                На данный момент изменить размер минимальной выплаты невозможно!\n\n                Если вы больше не будете пользоваться пулом, мы тоже не сможем сделать вам выплату, если баланс не\n                достиг минимально необходимой величины.\n\n                Все монеты, накопленные майнером на определенном адресе, могут быть выплачены только на этот адрес.\n                Кошельки нельзя объединить или суммировать накопленные монеты на разных адресах. Нельзя произвести\n                выплату на другой кошелек.\n\n\n\n                2Miners майнинг-пул: https://2miners.com/\n\n                2Masternodes хостинг и покупка долей в мастернодах: https://2masternodes.com/\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"headingTwo\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo\"\n                    aria-expanded=\"false\" aria-controls=\"collapseTwo\">\n                    Мой хешрейт на пуле ниже, чем в майнере. Низкая скорость.\n                </button>\n            </h5>\n        </div>\n        <div id=\"collapseTwo\" class=\"collapse\" aria-labelledby=\"headingTwo\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                Ваша скорость будет плавно расти после начала работы с пулом, имейте терпение и не паникуйте. Учтите,\n                что пул измеряет скорость на основании количества присланных вами ШАР. Это значение скорости может\n                немного отличаться от данных в вашем майнере.\n\n\n\n                2Miners майнинг-пул: https://2miners.com/\n\n                2Masternodes хостинг и покупка долей в мастернодах: https://2masternodes.com/\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"headingThree\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseThree\"\n                    aria-expanded=\"false\" aria-controls=\"collapseThree\">\n                    Мне выбрать Пул или Соло (Solo) Пул?\n                </button>\n            </h5>\n        </div>\n        <div id=\"collapseThree\" class=\"collapse\" aria-labelledby=\"headingThree\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                Выбирайте Пул.\n\n                Соло можно майнить, если у вас достаточно майнинг-мощностей, и вы знаете как это работает.\n\n                Как работает SOLO майнинг на пальцах.\n\n\n\n                2Miners майнинг-пул: https://2miners.com/\n\n                2Masternodes хостинг и покупка долей в мастернодах: https://2masternodes.com/\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"headingFour\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseFour\"\n                    aria-expanded=\"false\" aria-controls=\"collapseFour\">\n                    Как работает система выплат пула PPLNS?\n                </button>\n            </h5>\n        </div>\n        <div id=\"collapseFour\" class=\"collapse\" aria-labelledby=\"headingFour\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                2Miners использует честную систему выплат PPLNS. При нахождении блока выплаты майнерам производятся\n                согласно доле их вклада в последние N шар пула. И так беспрерывно. Это помогает обезопасить майнеров\n                пула от различных способов обмана со стороны нечестных майнеров. Для разных монет учитывается разное\n                количество последних шар пула (N).\n\n                Grin - последние 60000 шар\n\n                Ethereum - последние 50000 шар\n\n                Equihash, Equihash 144.5, Cryptonight, MTP, Aeternity - последние 20000 шар\n\n                Dagger Hashimoto (кроме Ethereum) - последние 12000 шар\n\n                На странице статистики майнера отображается доля его шар в процентах на текущий момент, а также\n                вознаграждение, которое он получит, если блок будет найден прямо сейчас. Эти данные ориентировочные.\n                Например, блок может включать много транзакций и стоить больше, либо он может, наоборот, быть Uncle или\n                Orphan.\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"heading5\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapse5\"\n                    aria-expanded=\"false\" aria-controls=\"collapse5\">\n                    Мое вознаграждение меньше чем должно быть. Uncle и Orphan блоки.\n                </button>\n            </h5>\n        </div>\n        <div id=\"collapse5\" class=\"collapse\" aria-labelledby=\"heading5\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                В сети Ethereum, а также других Ethash монет, есть Uncle и Orphan блоки.\n\n                Uncle блок - это блок, который не является частью самой длинной цепи. Ethereum поощрает майнеров,\n                которые находят такие блоки. Это увеличивает децентрализацию майнинга, а также безопасность сети. Лишь\n                малая доля работы, совершаемая фермами идет впустую, они почти всегда получают вознаграждение.\n\n                Вознаграждение Uncle блоков меньше, чем обычных блоков. Uncle блоки отмечаются серым цветом в списке\n                блоков пула (обычные блоки отмечены зеленым).\n\n                Orphan блок - отклоненный блок. Чаще всего блок бывает отклонен сетью, когда другой пул находит точно\n                такое же решение, но чуть раньше нашего пула (несколько миллисекунд).\n\n                За Orphan блок пул не получает вознаграждение. Перед Orphan блоком в списке пулов написано \"Отклонен\".\n\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"heading6\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapse6\"\n                    aria-expanded=\"false\" aria-controls=\"collapse6\">\n                    Неподтвержденный баланс - что это значит?\n                </button>\n            </h5>\n        </div>\n        <div id=\"collapse6\" class=\"collapse\" aria-labelledby=\"heading6\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                Каждый блок, найденный пулом, должен быть подтвержден сетью, прежде чем пул получит за него\n                вознаграждение. Это означает, что после нахождения блока в сети должно быть найдено определнное\n                количество новых блоков.\n\n                В разделе \"Блоки\" на каждом пуле вы можете найти информацию о том, сколько блоков необходимо в сети\n                выбранной вами монеты. Например в сети Bitcoin Gold для подтверждения необходимо 100 новых блоков 10\n                минут в среднем каждый = 20 часов для того чтобы баланс перешел из Неподтвержденного в Баланс к выплате.\n\n                Подтверждение блока у каждой монеты занимает разное время.\n\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"heading7\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapse7\"\n                    aria-expanded=\"false\" aria-controls=\"collapse7\">\n                    Как настроить SSL соединение с майнинг-пулом?\n                </button>\n            </h5>\n        </div>\n        <div id=\"collapse7\" class=\"collapse\" aria-labelledby=\"heading7\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                На пулах 2Miners доступно подключение с использованием SSL.\n                Таблица SSL портов для каждой монеты приведена в самом низу страницы \"Как начать?\".\n\n                Например для Ethereum (ETH):\n                https://eth.2miners.com/ru/help\n\n\n\n                Пожалуйста, обратите внимание, что настройки вашего майнера могут отличаться от стандартных.\n\n                PhoenixMiner (Ethash монеты)\n\n                Добавьте ssl:// перед адресом пула, например:\n                PhoenixMiner.exe -coin eth -pool ssl://eth.2miners.com:12020 -wal YOUR_ADDRESS.RIG_ID\n\n                Claymore\'s (Ethash монеты)\n\n                Добавьте ssl:// перед адресом пула, например:\n                EthDcrMiner74.exe -epool ssl://eth.2miners.com:12020 -eworker RIG_ID -ewal YOUR_ADDRESS -epsw x\n\n                Ethminer (Ethash монеты)\n\n                Добавьте stratum1+tls:// перед адресом пула, например:\n                ethminer.exe --farm-recheck 2000 -U -P stratum1+tls://YOUR_ADDRESS.RIG_ID@eth.2miners.com:12020\n\n                Gminer (AE, GRIN, BTG, BTCZ, ZEL)\n\n                Добавьте --ssl 1 параметр, например:\n                miner.exe --algo aeternity --server ae.2miners.com --port 14040 --user YOUR_ADDRESS.RIG_ID --ssl 1\n\n                T-Rex (RVN, XZC)\n\n                Добавьте stratum+ssl:// перед адресом пула, например:\n                t-rex.exe -a x17r -o stratum+ssl://rvn.2miners.com:17070 -u YOUR_ADDRESS.RIG_ID -p c=RVN\n\n                XMR-Stak (Monero)\n\n                Используйте \"use_tls\": true параметр, например:\n                {\n                \"pool_list\": [\n                {\n                \"pool_address\": \"xmr.2miners.com:12222\",\n                \"wallet_address\": \"YOUR_ADDRESS\",\n                \"rig_id\": \"RIG_ID\",\n                \"pool_password\": \"x\",\n                \"use_nicehash\": false,\n                \"use_tls\": true,\n                \"tls_fingerprint\": \"\",\n                \"pool_weight\": 1\n                }\n                ],\n                \"currency\": \"monero\"\n                }\n\n\n\n                Если вы не знаете что такое SSL соединение и как его настроить, используйте стандартные настройки.\n\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"heading8\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapse8\"\n                    aria-expanded=\"false\" aria-controls=\"collapse8\">\n                    Сколько я смогу получить с моим хешрейтом?\n                </button>\n            </h5>\n        </div>\n        <div id=\"collapse8\" class=\"collapse\" aria-labelledby=\"heading8\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                Существует несколько способов оценить ваше потенциальное вознаграждение.\n\n                Лучшим калькулятором для майнинга на пуле и в Соло-режиме является https://2cryptocalc.com/\n\n                Вы можете воспользоваться другими майнинг-калькуляторами, например:\n                https://whattomine.com/ или https://crypt0.zone/calculator\n\n                Вы также можете зайти в раздел \"Майнеры онлайн\", интересующей вас монеты, и найти майнера с хешрейтом,\n                схожим с вашим. Посмотрите на его статистику выплат, чтобы получить представление о том, сколько вы\n                можете заработать на пуле за 1 час/12 часов/1 день/1 неделю/1 месяц. Обратите внимание, что этот способ\n                работает только в том случае, если майнер, статистику которого вы смотрите, был онлайн на протяжении\n                всего интересующего вас периода времени.\n\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"heading9\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapse9\"\n                    aria-expanded=\"false\" aria-controls=\"collapse9\">\n                    Кошелек - как создать кошелек для криптовалюты?\n                </button>\n            </h5>\n        </div>\n        <div id=\"collapse9\" class=\"collapse\" aria-labelledby=\"heading9\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                У каждой криптовалюты есть официальный кошелек с полной копией блокчейна. Обычно он занимает много\n                свободного места на компьютере. Еще бывают веб-кошельки.\n\n                Вы можете сгенерировать адрес на одной из криптовалютных бирж. 2Miners прекрасно с ними работает.\n\n                Информацию о рекомендованных кошельках и биржах, которые поддерживают данную монету, можно найти в\n                разделе \"Начало работы\".\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"card-header\" id=\"heading10\">\n            <h5 class=\"mb-0\">\n                <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapse10\"\n                    aria-expanded=\"false\" aria-controls=\"collapse10\">\n                    Можно ли майнить на кошелек биржи?\n                </button>\n            </h5>\n        </div>\n        <div id=\"collapse10\" class=\"collapse\" aria-labelledby=\"heading10\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                Да, вы можете майнить напрямую на кошелек биржи, даже если на бирже написано, что этого делать нельзя.\n                2Miners прекрасно работает с кошельками бирж.\n            </div>\n        </div>\n    </div>\n</div>\n!-->\n\n<div id=\"FAQETH\" class=\"content container-fluid\" style=\"display: none; margin-top: 40px;\"> 2222 </div>\n\n<div id=\"FAQLTC\" class=\"content container-fluid\" style=\"display: none; margin-top: 40px;\"> 3333 </div>\n\n<div id=\"FAQRVN\" class=\"co