я использования (УИ) майнинг-пулов http://2miners.com (вебсайт).\nПрежде чем войти на вебсайт, пожалуйста, прочтите данный документ. Выполняя вход на вебсайт вы соглашаетесь с нижеследующими условиями. ЕСЛИ ВЫ НЕ СОГЛАСНЫ С НАСТОЯЩИМИ УСЛОВИЯМИ, НЕ ИСПОЛЬЗУЙТЕ ДАННЫЙ ВЕБСАЙТ.</p>\n<p>Термины и определения:<br>Майнер, вы, пользователь - человек, который заходит на сайт и принимает его УИ.\nПул, майнинг-пул, мы, 2Miners, вебсайт - майнинг-пул 2Miners и соответствующий вебсайт http://2miners.com. </p>\n<h3>Основные положения</h3>\n<p>Если вы используете данные вебсайт и его сервисы, вы берете на себя все риски связанные с использованием данного вебсайта. Пул не может компенсировать никакие потери майнера.</p>\n<p>Чтобы использовать данный вебсайт и его сервисы, пользователь должен быть старше двадцати одного (21) года. Если вы используете данный сайт и сервисы, вы подтверждаете, что вам есть, как минимум, двадцать один (21) год.</p>\n<h3>Ограничение ответственности</h3>\n<p>В рамках действующего законодательства, пул предоставляет данный сайт и его содержание на основании принципа “как есть”, и не выражает каких-либо гарантий любого рода в отношении данного сайта и его содержания.</p>\n<p>Мы не несем никакой ответственности за любой вред или ущерб, полученный или нанесенный компаниям или частным лицам, вследствие использования сервисов майнинг пула 2Miners, в том числе: потери прибыли или другой выгоды, ущерб нанесенный вашему компьютеру или другому вычислительному оборудованию, программному обеспечению, потери информации. Все материалы и сервисы пула вы используете на свой страх и риск.</p>\n<p>Пул - не является электронным кошельком для хранения ваших монет. Пул не несет никакой ответственности за монеты, которые на нем хранятся.</p>\n<p>Постоянное время работы (аптайм) пула и вебсайта не гарантированы. Пул может быть выключен для разного рода работ и обновлений в любое необходимое время. Пользователи несут полную ответственность за то, чтобы конфигурировать свое программное обеспечение таким образом, чтобы в случае неполадок, оно переключалось на майнинг других монет или на другой пул.\n<p>В связи с тем, что майнинг - сложный вычислительный процесс, ваше оборудование может потреблять много электроэнергии. Пул не несет никакой ответственности за эти расходы.</p>\n<h3>Выплаты</h3>\n<p>В зависимости от выбранной криптовалюты и системы выплат пула комиссия пула составляет: 1% на совместных пулах PPLNS и 1.5% на SOLO пулах. Комиссия вычитается до того, как совершаются выплаты майнерам.</p>\n<p>PPLNS - совместный пул. Все майнеры сообща ищут блок. Когда один из майнеров пула находит блок, награда распределяется среди майнеров в соответствии с долей их вклада в последние N шар пула, независимо от того, кто из майнеров нашел блок. В течение двух часов после того как найденный блок подтвержден, все майнеры, набравшие минимальное количество монет для выплаты, получают выплату на свой указанный кошелек.</p>\n<p>В SOLO пуле вы майните в одиночку. Вам никто не помогает, но если вы находите блок, вы один полностью получаете вознаграждение за него на указанный вами кошелек.</p>\n<p>Все монеты, накопленные майнером на определенном адресе, могут быть выплачены только на этот адрес. Кошельки нельзя объединить или суммировать накопленные монеты на разных адресах. Нельзя произвести выплату на другой кошелек.</p>\n<p>Лимит газа для выплат на адреса Dagger Hashimoto (Ethash) монет составляет 50000.</p>\n<h3>Персональные данные</h3>\n<p>Мы используем IP адреса и адреса криптовалютных кошельков в целях оказания сервисов и поддержания работы пула. Ваша персональная информация может быть привязана к информации браузера, другим аффилированным компаниям пула или третьим лицам (например, поставщикам услуг хостинга) в целях, описанных выше и в политике использования файлов cookie, а также в целях администрирования групп. </p>\n<p>Мы стремимся защищать конфиденциальность ваших персональных данных. Ваши персональные данные хранятся на защищенном компьютере. Сервер, который пул использует для хранения данных, доступен уполномоченным сотрудникам пула только под строгим контролем. Сервер подключен к сети Интернет через брандмауэр и не является общедоступным.</p>\n<p>Небольшие файлы с данными, известные как файлы cookie, будут устанавливаться на Ваш компьютер с целью сбора статистической информации, включая пути навигации, количество посещений, возвращение клиентов и количество посещений определенной страницы. Файлы cookie могут содержать только те персональные данные, которые Вы предоставите сами. Они не могут считывать данные в Вашего жесткого диска. Мы используем файлы cookie, чтобы определить полезность предоставляемой нами информации и удобство использования сайта. Пул не передает информацию, полученную через файлы cookie, другим компаниям и не продает ее третьим сторонам. Если Вы не хотите получать файлы cookie с нашего веб-сайта, Вы можете настроить браузер таким образом, чтобы он запрашивал разрешение на файлы cookie, и Вы можете отказаться от таких файлов. Вы также можете отказаться от файлов cookie, отключив их в браузере. Вы не обязаны включать файлы cookie, чтобы использовать вебсайт.</p>\n<h3>Форс-мажор</h3>\n<p>Пул не несет никакой ответственности за полное или частичное отключение, перерыв в работе, если это будет являться прямым следствием обстоятельств непреодолимого (форс-мажорного) характера, находящихся вне контроля пула и майнеров. Форс–мажорными обстоятельствами являются: военные действия, забастовки, пожары, наводнения, землетрясения и иные стихийные бедствия.</p>\n<h3>Неактивные адреса</h3>\n<p>Балансы майнинг-адресов, которые не проявляют никакой заметной активности на протяжении одного года (365 дней) могут быть обнулены и будут рассматриваться как пожертвование в адрес пула.</p>','{\"title\":true}'),(16,'privacy','<h1>Политика обработки персональных данных</h1>\n<p>Политика обработки персональных данных (ПОПД) майнинг-пулов http://2miners.com (вебсайт).\nПрежде чем войти на вебсайт, пожалуйста, п